<style>
.right-invoice {
    text-align: right;
    margin-left: 0;
    margin-bottom: -55px;
    font-size: 40px;
    font-weight: 700;
}
.signature-left {
    text-align: center;
    border: 1px solid #fff;
    padding-top: 100px;
}
.signature-right {
    text-align: center;
    border: 1px solid #fff;
    padding-top: 100px;
}
.footer p {
    text-align: center;
}
.info-table {
    display: block;
    overflow-x: auto;
}
.order-addresses {
    display: table;
    width: 100%;
}
.shipping-address {
    display: table-cell;
}
.order-info,
table th,
table td {
    padding: 3px 12px;
}
.order-info {
    margin-bottom: 40px;
}
table thead, th {
    font-size: 18px;
}
table {
    width: 100%;
    border-collapse: collapse;
    display: table;
    box-sizing: border-box;
    text-indent: initial;
    border-spacing: 0px;
}

*,
::after,
::before {
    box-sizing: border-box;
}
tbody {
    display: table-row-group;
    vertical-align: middle;
    border-color: inherit;
}
table th {
    border: 1px solid black;
}
table td {
    border: 1px solid black;
}

@media print {
    .info-table {
        padding: 70px 70px;
    }
    .h3.company-address {
        background: #0a5fa2 !important;
    }
    .billing-address h3 {
        background: #0a5fa2 !important;
    }

    table.order-items thead {
        background: #0a5fa2 !important;
    }

    .no-print {
        display: none;
    }
}

    
</style>

